		private static readonly string DefaultFilePath = Path.Combine(FolderPaths.PluginPath, "Cache", "External", "Dictionaries", "Cache_UnitData.xml");
		public static UnitData DeserializeFromXML()
		{
			var deserializer = new XmlSerializer(typeof(UnitData));
			TextReader textReader = new StreamReader(DefaultFilePath);
			var settings = (UnitData)deserializer.Deserialize(textReader);
			textReader.Close();
			return settings;
		}
		public static UnitData DeserializeFromXML(string FolderPath)
		{
			if (!Directory.Exists(FolderPath))
				return null;

			string FilePath = Path.Combine(FolderPath, "Cache_UnitData.xml");

			var deserializer = new XmlSerializer(typeof(UnitData));
			TextReader textReader = new StreamReader(FilePath);
			var settings = (UnitData)deserializer.Deserialize(textReader);
			textReader.Close();
			return settings;
		}

		public static void SerializeToXML(UnitData settings)
		{
			var serializer = new XmlSerializer(typeof(UnitData));
			var textWriter = new StreamWriter(DefaultFilePath);
			serializer.Serialize(textWriter, settings);
			textWriter.Close();
		}
		public static void SerializeToXML(UnitData settings, string FolderPath)
		{
			string FilePath = Path.Combine(FolderPath, "Cache_UnitData.xml");
			var serializer = new XmlSerializer(typeof(UnitData));
			var textWriter = new StreamWriter(FilePath);
			serializer.Serialize(textWriter, settings);
			textWriter.Close();
		}

